import covid from '../../assets/covid-banner.png'
import backdrop from '../../assets/backdrop.jpeg'

import './Home.css';
import { Link } from 'react-router-dom';

class Home extends Component {
    render () {

        let pressData = press.slice(0, 10);
        let newsData = news.slice(0, 10);

        return (
            <Fragment>
                <Navbar></Navbar>
                <img src={backdrop} alt="SB Courthouse"/>
                <div className="flex flex-row">
                    <div className="flex flex-row justify-center align-center p-4 w-6/12" style={{backgroundColor: 'rgba(112,112,112,0.1)'}}>
                        <div className="">
                            Our Mission
